import React from 'react';
import ovos from '../rotator/ovos-icon-white.png';
import cir from '../rotator/green-foreground.svg';
import cir2 from '../rotator/blue-background.svg';
import cir3 from '../rotator/red-foreground.svg';
import cir4 from '../rotator/red-background.svg';
import cir5 from '../rotator/yellow-foreground.svg';
import cir6 from '../rotator/yellow-background.svg';
import cir7 from '../rotator/green-background.svg';
import cir8 from '../rotator/white-foreground.svg';
import cir9 from '../rotator/white-background.svg';
import SecCir from '../rotator/blue-foreground.svg';

function CallToAction(){
    return(
      <div className="details-cir"> 
      <div className="Circles">
        <img src={SecCir} className="App-logos" alt="logo" />
        <img src={cir2} className="App-logos"/>
        <img src={cir3} className="App-logos"/>
        <img src={cir4} className="App-logos"/>
        <img src={cir5} className="App-logos"/>
        <img src={cir6} className="App-logos"/>
        <img src={cir} className="App-logos"/>
        <img src={cir7} className="App-logos"/>
        <img src={cir8} className="App-logos"/>
        <img src={cir9} className="App-logos"/>
      </div>
        <div>
            <ul className="call-to-action">
        <li>
          <span className="ovos">O V O S</span>
          </li>
        <li>
        <span className="mix">MIXING</span>
          <p>Platinum Deals</p>
        </li> 
        <li>
          <span className="master">MASTERING</span>
          <p className="deals">Platinum Deals</p>
        </li>
      </ul>
      </div>
      <div>
      <ul className="call-to-actions">
          <ul>
            </ul>
      </ul>
        </div>
        </div>
    )
}

export default CallToAction;
